def add_coords(target_dir, lats, lons, region):
    """
    Add lat, lon points to csv so we can use this for plotting later on
    """
    if region == 'northamerica':
        points = 1519
    if region == 'europe':
        points = 837

    for f in os.listdir(target_dir):
        if f == '.DS_Store':
            continue
        print('Running script for file {}'.format(f))
        df = pd.read_csv('{}/{}'.format(target_dir, f))
        total_entries = len(df)
        list_multiplier = int(total_entries/points)
        lat_list = lats*list_multiplier
        lon_list = lons*list_multiplier
        df['lon'] = lon_list
        df['lat'] = lat_list
        df.to_csv('{}/{}_with_coords.csv'.format(target_dir, f[:-4]))

